begin
wwv_flow_imp_shared.create_plugin(
 p_id=>wwv_flow_imp.id(67497848679639507)
,p_plugin_type=>'DYNAMIC ACTION'
,p_name=>'COM.UK.EXPLORER.DLAR'
,p_display_name=>'Download APEX Report'
,p_category=>'EXECUTE'
,p_supported_ui_types=>'DESKTOP'
,p_image_prefix => nvl(wwv_flow_application_install.get_static_plugin_file_prefix('DYNAMIC ACTION','COM.UK.EXPLORER.DLAR'),'&G_DLAR_FILE_PREFIX.')
,p_javascript_file_urls=>'#PLUGIN_FILES#js/explorerDLAR#MIN#.js'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'  /*-------------------------------------',
'  * Name: Download APEX Report',
'  * Version: 19.2.1',
'  * Author:  Matt Mulvaney',
'  *-------------------------------------',
'  */',
'  FUNCTION render(p_dynamic_action IN apex_plugin.t_dynamic_action,',
'                  p_plugin         IN apex_plugin.t_plugin)',
'  RETURN apex_plugin.t_dynamic_action_render_result ',
'  IS',
'    -- plugin attributes',
'    l_result                   apex_plugin.t_dynamic_action_render_result;',
'    l_download_format          p_dynamic_action.attribute_01%TYPE := p_dynamic_action.attribute_01; ',
'    l_suppress_message         p_dynamic_action.attribute_02%TYPE := p_dynamic_action.attribute_02; ',
'    l_other_format             p_dynamic_action.attribute_03%TYPE := apex_plugin_util.replace_substitutions(p_dynamic_action.attribute_03); ',
'    l_warn_on_unsaved_changes  apex_application_pages.warn_on_unsaved_changes%TYPE DEFAULT NULL;',
'    l_report_regions           VARCHAR2(32767) DEFAULT NULL;',
'    ',
'    -- Types',
'    c sys_refcursor;',
'    ',
'  BEGIN',
'',
'    -- Debug',
'    IF apex_application.g_debug ',
'    THEN',
'      apex_plugin_util.debug_dynamic_action(p_plugin         => p_plugin,',
'                                            p_dynamic_action => p_dynamic_action);',
'    END IF;',
'    ',
'    SELECT warn_on_unsaved_changes',
'      INTO l_warn_on_unsaved_changes',
'      FROM apex_application_pages',
'     WHERE application_id = :APP_ID',
'       AND page_id = :APP_PAGE_ID;',
'       ',
'     apex_json.initialize_clob_output;  ',
'     OPEN c FOR',
'     SELECT nvl(static_id, ''R'' || region_id) affectedID, ',
'            static_id staticId, ',
'            to_char( region_id ) regionID,',
'            source_type_plugin_name regionType',
'       FROM apex_application_page_regions ',
'      WHERE application_id = :APP_ID',
'        AND page_id IN ( 0, :APP_PAGE_ID )',
'        AND source_type_plugin_name IN ( ''NATIVE_IG'', ''NATIVE_IR'', ''NATIVE_SQL_REPORT'');',
'     apex_json.write(c);',
'     l_report_regions := apex_json.get_clob_output;',
'     apex_json.free_output;',
'    ',
'      l_result.javascript_function := ',
'      q''[function() {',
'        explorerDLAR.render({',
'          da: this,',
'          page: {warnOnUnsavedChanges: #warnOnUnsavedChanges# },',
'          reportRegions: #reportRegions#',
'        });',
'      }]'';',
'      ',
'   l_result.javascript_function := REPLACE( l_result.javascript_function, ''#warnOnUnsavedChanges#'', apex_debug.tochar(l_warn_on_unsaved_changes = ''Yes'') );      ',
'   l_result.javascript_function := REPLACE( l_result.javascript_function, ''#reportRegions#'', l_report_regions );      ',
'',
'    l_result.attribute_01 := CASE l_download_format WHEN ''OTHER'' THEN l_other_format ELSE l_download_format END; ',
'    l_result.attribute_02 := l_suppress_message;',
'    RETURN l_result;',
'',
'  END render;'))
,p_api_version=>2
,p_render_function=>'render'
,p_standard_attributes=>'REGION:REQUIRED'
,p_substitute_attributes=>true
,p_subscribe_plugin_settings=>true
,p_version_identifier=>'19.2.1'
,p_about_url=>'https://github.com/ExplorerUK/Download-APEX-Report-Plugin'
,p_files_version=>9
);
